import './Footer.css';

function Footer() {
    return (
        <div className="footer">
            <div className="wrapper">
                <div className="footerContainer"><p>@ComprenXible. Todos los derechos reservados.</p>
                    <a href="#privacy">Politica de privacidad</a>
                </div>
            </div>
        </div>

    );
}

export default Footer;
